nexusDescription="[size=6][b]Alpha Wolves Enabled\xa0[/b][/size]\n<br />\n<br />[font=Lucida Sans Unicode]\n<br />[size=3]Simple mod that adds spawn data to the alpha wolf that already existed in the game but does not appear in any part of the world.[/size]\n<br />\n<br />[size=3]With this plugin the alpha wolves show up here and there and that's kinda epic.\xa0[/size]\n<br />\n<br />\n<br />[size=3]Plugin is form 44 and flagged as ESL for space reasons.[/size]\n<br />\n<br />\n<br />[size=3]Optional Size Tweak changes the height of the wolfs in Skyrim. Makes them a bit smaller and keeps the ALPHA the same size.\n<br />[/size]\n<br />[size=3][u]Exact tweaks[/u]:[/size]\n<br />\n<br />[center][img]data:image/png;base64,[/img][/center][/font][font=Lucida Sans Unicode][size=5]Installation MO2\n<br />[/size]\n<br />\n<br />[size=3]Install it like any other mod. Make sure the plugin is placed after your other creature mods just to make sure it works.\n<br />[/size]\n<br />\n<br />\n<br />[size=5]Credits\xa0[/size]\n<br />\n<br />[size=3][url=https://www.nexusmods.com/skyrim/users/10523870]Gildris [/url]for his forgotten mod.[/size]\n<br />[size=3][url=https://www.nexusmods.com/users/3880206]Vic[/url][b],\xa0[/b][/size][size=3][url=https://www.nexusmods.com/skyrimspecialedition/users/65357736]Prick[/url]\xa0\x61nd\xa0[url=https://www.nexusmods.com/users/91403708]Mahi[/url][b]\xfeff\xa0[/b]for the company + screenshots\n<br />And Gim server for making me want to mod and stuff.[/size]\n<br />\n<br />\n<br />[size=5][b][size=5][b]My other mods (and a few more not listed)\n<br />\n<br />\n<br />[/b][/size][b][url=https://www.nexusmods.com/skyrimspecialedition/mods/43139][img]https://i.imgur.com/UDIr2m2.png[/img][/url][/b][/b][/size]\n<br />[font=Lucida Sans Unicode]\n<br />[/font][font=Lucida Sans Unicode][url=https://www.nexusmods.com/skyrimspecialedition/mods/42422][img]https://i.imgur.com/qh1BDtL.png[/img][/url][/font]\n<br />[/font]\n<br />[url=https://www.nexusmods.com/s